import './App.css';

function App() {


  const fetchData = async()=>{

     const url = 'https://api.openweathermap.org/data/2.5/weather?q=pune&appid=2d4a63ea0bfee20697bf482725ccf5b0';
     const data = await fetch(url);
     const result = await data.JSON();
     console.log(result);
  }
  fetchData();




  return (
    <>

    <h1><center>This is app</center></h1>
     <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" />    
    </>
  );
}

export default App;
